import React from 'react';
import  ReactDOM  from 'react-dom';
// import './index.css';
// import App from './App';
import { add ,mult,sub,div} from './Calc';


ReactDOM.render(
<>
  <ul>
    <li>Division of two num is{div(22,2)}</li>
    <li>Multiplicatin of two num is{mult(22,2)}</li> 
    <li>Sum of two num is{add(22,2)}</li>
     <li>Sub of two num is{sub(22,2)}</li>
  </ul>
</>,
document.getElementById("root")
);
